import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card';
import CardList from './Cardlist'
import 'tachyons'
import {robots} from './robots.js'
import reportWebVitals from './reportWebVitals';

ReactDOM.render(
  <div>
  <CardList robots={robots}/>
